import React from 'react';
import ReactDOM from 'react-dom';
// import youTuber, {favProg,myName,myNames} from './App';
import * as ques from './App';
ReactDOM.render(
 <>
  <ol>
      <li>Asit</li>
      <li>{ques.default}</li>
      <li>{ques.favProg}</li>
      <li>{ques.myName()}</li>
      <li>{ques.myNames()}</li>
  </ol>
 </>
 ,document.getElementById("root")
);
